class SimpleMap extends Component {
  render(){
    return(
      <div id="map-container-google-2" className="z-depth-1-half map-container">
        <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d857971.4008117487!2d36.02225686132374!3d32.85979051536083!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x151c378974aa5475%3A0xa565f1714d69b62f!2z157Xl9eV15Yg15TXptek15XXnywg15nXqdeo15DXnA!5e0!3m2!1siw!2sus!4v1619109244455!5m2!1siw!2sus" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy"></iframe>
      </div>
    )
  }
}

export default SimpleMap;
